import ReactMapGL from 'react-map-gl';

class Map extends Component {

  state = {
    viewport: {
      width: 400,
      heigh: 400 ,
      latitude: 37.7577,
      longitude: -122.4376,
      zoom: 8
    }
  };

  render() {
    return(
      <div>
      <h1> Renderingt the map here! </h1>
      <ReactMapGL
        {...this.state.viewport}
        onViewportChange={(viewport) => this.setState({viewport})}
        mapboxApiAccessToken="pk.eyJ1IjoibmFtcmF0YS1oYXJpYmFsIiwiYSI6ImNrMXV3emw3OTBoeXMzYm9qMGlhN3FyNmgifQ.OHK6hKFL9CTEPCYbd9SDfQ"
        />
      </div>

    );
  }
  }


export default Map
